⁣
La receta de hoy es un 2 en uno, aprenderemos a hacer nuestra receta de ✔️avena fría para el desayuno y ✔️mermelada casera de frutos rojos❣️⁣
⁣
PARA LA MERMELADA 💪⁣
⁣
❣️80 gramos de agraz⁣
❣️50 gramos de arándanos⁣
❣️jugo de una naranja o media🍊⁣
❣️stevia yo uso la de ⁣
⁣
1. Ponemos un antiadherente a calentar y adicionamos el agraz. ❣️⁣
2. Dejamos un minuto allí para que suelte jugo y añadimos 🍓los arándanos.⁣
3. Pasado un minuto más machacamos y dejamos cocinar un poco más con la llama media, baja. 😍⁣
4. Adiciona el jugo de naranja y stevia al gusto, revuelve y deja cocinar par minutos hasta lograr el espesor 😋deseado ⁣
5. Deja enfriar y guarda en un recipiente de vidrio en tu nevera⁣
⁣
PARA LA AVENA FRÍA ⁣
⁣
✔️Avena en hojuelas, usé para las dos porciones 80 gramos ⁣
✔️Par cucharadas de semillas de chía⁣
✔️Stevia líquida⁣
✔️Fruta al gusto⁣
✔️Mermelada casera de frutos rojos⁣
⁣
1. La avena la hago en agua, 😍la pongo a hervir par minutos y estuvo.⁣
2. Dejo enfriar y adiciono 💪la estevia. ⁣
3. Divido la avena dos partes, a una le adiciono la chía y♥️ a la otra una cucharada de mermelada para que quede rosa⁣
4. Empiezo ✔️a llenar los vasos arrancando por la mermelada, luego avena con chia, fruta y avena con mermelada, repito las capasa hasta llenar❣️⁣
⁣
